import React, { useState, useEffect, useRef } from 'react';
import { signInWithEmailAndPassword } from 'firebase/auth';
import { auth } from './firebase';
import { NavLink, useNavigate } from 'react-router-dom';
import { useSpring, animated } from '@react-spring/web';

const Login = () => {
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [errorMsg, setErrorMsg] = useState('');
    const [isTyping, setIsTyping] = useState(false);
    const [typedText, setTypedText] = useState('');
    const footerRef = useRef(null);

    const fullText = "ADHDR: Streamlining ADHD Diagnosis with Modern Tools";

    // Fade-in animation for login container
    const fadeProps = useSpring({
        opacity: 1,
        transform: 'translateY(0px)',
        from: { opacity: 0, transform: 'translateY(100px)' },
        config: { duration: 800 },
    });

    // Typing effect logic
    useEffect(() => {
        const observer = new IntersectionObserver(
            ([entry]) => {
                if (entry.isIntersecting) {
                    setIsTyping(true);
                }
            },
            { threshold: 0.5 }
        );
        if (footerRef.current) {
            observer.observe(footerRef.current);
        }
        return () => observer.disconnect();
    }, []);

    useEffect(() => {
        if (!isTyping) return;

        let index = 0;
        setTypedText('');
        const typingInterval = setInterval(() => {
            if (index < fullText.length) {
                setTypedText((prev) => prev + fullText.charAt(index));
                index++;
            } else {
                clearInterval(typingInterval);
            }
        }, 100);

        return () => clearInterval(typingInterval);
    }, [isTyping]);

    const onLogin = (e) => {
        e.preventDefault();
        setErrorMsg('');
        if (!email || !password) {
            setErrorMsg('Please fill in all fields!');
            return;
        }
        signInWithEmailAndPassword(auth, email, password)
            .then(() => {
                navigate('/');
            })
            .catch(() => {
                setErrorMsg('Error! Invalid credentials. Please try again.');
            });
    };

    return (
        <div className="login-page">
            {/* Header */}
            <div className="header">
                <div className="nav-item" onClick={() => navigate('/')}>
                    ADHDR
                </div>
                <div className="nav-item" onClick={() => navigate('/about-us')}>
                    About Us
                </div>
                <div className="nav-item" onClick={() => navigate('/adhd-resources')}>
                    ADHD Resources
                </div>
                <div className="nav-item" onClick={() => navigate('/contact')}>
                    Contact Us
                </div>
                <div className="nav-item nav-active" onClick={() => navigate('/login')}>
                    Login
                </div>
            </div>

            {/* Login Form */}
            <animated.div style={fadeProps} className="login-container">
                <h1 className="login-title">Login</h1>
                {errorMsg && <p className="error-msg">{errorMsg}</p>}
                <form onSubmit={onLogin} className="login-form">
                    <div className="input-group">
                        <label htmlFor="email-address" className="input-label">
                            Email address
                        </label>
                        <input
                            id="email-address"
                            name="email"
                            type="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            required
                            placeholder="Enter your email"
                            className="input-field"
                        />
                    </div>
                    <div className="input-group">
                        <label htmlFor="password" className="input-label">
                            Password
                        </label>
                        <input
                            id="password"
                            name="password"
                            type="password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                            placeholder="Enter your password"
                            className="input-field"
                        />
                    </div>
                    <button type="submit" className="login-button">
                        Login
                    </button>
                </form>
                <p className="signup-text">
                    No account yet?{' '}
                    <NavLink to="/signup" className="signup-link">
                        Sign up
                    </NavLink>
                </p>
            </animated.div>

            {/* Footer */}
            <div className="navigation-footer" ref={footerRef}>
                <p className="footer-text">
                    {typedText}
                    {typedText.length < fullText.length && <span className="ellipsis">...</span>}
                </p>
            </div>
        </div>
    );
};

export default Login;
